import{_ as p}from"./_plugin-vue_export-helper.cdc0426e.js";import{o,c as e,f as c}from"./app.cd90e563.js";const d={},t=c('<h1 id="\u897F\u9B4F\u6539\u9769" tabindex="-1"><a class="header-anchor" href="#\u897F\u9B4F\u6539\u9769" aria-hidden="true">#</a> \u897F\u9B4F\u6539\u9769</h1><blockquote><p>\u53C8\u4E3A\u516D\u6761\u8BCF\u4E66\uFF0C\u4E5D\u6708\uFF0C\u59CB\u594F\u884C\u4E4B\uFF1A\u4E00\u66F0\u6E05\u5FC3\uFF0C\u4E8C\u66F0\u6566\u6559\u5316\uFF0C\u4E09\u66F0\u5C3D\u5730\u5229\uFF0C\u56DB\u66F0\u64E2\u8D24\u826F\uFF0C\u4E94\u66F0\u6064\u72F1\u8BBC\uFF0C\u516D\u66F0\u5747\u8D4B\u5F79\u3002\u6CF0\u751A\u91CD\u4E4B\uFF0C\u5C1D\u7F6E\u8BF8\u5750\u53F3\uFF0C\u53C8\u4EE4\u767E\u53F8\u4E60\u8BF5\u4E4B\uFF0C\u5176\u7267\u5B88\u4EE4\u957F\u975E\u901A\u516D\u6761\u53CA\u8BA1\u5E10\u8005\uFF0C\u4E0D\u5F97\u5C45\u5B98\u3002</p></blockquote><p><strong>\u300A\u8D44\u6CBB\u901A\u9274\xB7\u5377\u4E00\u4E94\u516B\xB7\u6881\u7EAA\u5341\u56DB\u300B</strong></p><p><strong>\u82CF\u7EF0\u516D\u6761</strong></p><p><code>\u5317\u9B4F</code>\u5728\u5206\u88C2\u4E3A<code>\u4E1C\u897F\u9B4F</code>\u540E\uFF0C\u897F\u9B4F\u56E0\u4E3A\u56FD\u5F31\u6C11\u8D2B\uFF0C\u5148\u5929\u4E0D\u8DB3\uFF0C\u52BF\u529B\u8FDC\u6BD4\u4E0D\u4E0A\u4E1C\u9B4F\u3002\u4E3A\u6B64\uFF0C<code>\u5B87\u6587\u6CF0</code>\u4EFB\u7528<code>\u82CF\u7EF0</code>\u7B49\u6C49\u65CF\u58EB\u4EBA\uFF0C\u8FDB\u884C\u4E86\u4E00\u7CFB\u5217\u6539\u9769\u3002</p><p>\u6240\u8C13\u201C\u82CF\u7EF0\u516D\u6761\u201D\uFF0C\u5C31\u662F\u82CF\u7EF0\u5728\u6B64\u671F\u95F4\u901A\u8FC7\u603B\u7ED3\u6C49\u65CF\u7EDF\u6CBB\u9636\u7EA7\u7684\u7EDF\u6CBB\u7ECF\u9A8C\uFF0C\u6240\u521B\u7ACB\u7684\u671D\u5EF7\u65BD\u653F\u7EB2\u9886\u4E0E\u5730\u65B9\u5B98\u5458\u4E3A\u653F\u51C6\u5219\u3002</p><p>\u56E0\u4E3A\u8FD9\u516D\u6761\u8BCF\u4E66\u867D\u7136\u8868\u9762\u4E0A\u770B\u8D77\u6765\u5E73\u5E73\u65E0\u5947\uFF0C\u6CA1\u6709\u4EFB\u4F55\u5F02\u5F69\u593A\u76EE\u4E4B\u5904\uFF0C\u4F46\u4E8B\u5B9E\u4E0A\uFF0C<strong>\u6B63\u662F\u8FD9\u4E9B\u666E\u666E\u901A\u901A\u7684\u529E\u6CD5\uFF0C\u771F\u6B63\u89E3\u51B3\u4E86\u81EA\u4E94\u80E1\u4E71\u534E\u4EE5\u6765\u7684\u653F\u6CBB\u6DF7\u4E71\u5C40\u9762\u3002</strong></p><p>\u9996\u5148\u6765\u770B\u516D\u6761\u8BCF\u4EE4\u7684\u5177\u4F53\u5185\u5BB9\uFF1A</p><ul><li><p>\u5148\u6CBB\u5FC3</p></li><li><p>\u6566\u6559\u5316</p></li><li><p>\u5C3D\u5730\u5229</p></li><li><p>\u64E2\u8D24\u826F</p></li><li><p>\u6064\u72F1\u8BBC</p></li><li><p>\u5747\u8D4B\u5F79</p></li></ul><p>\u8FD9\u9700\u8981\u628A\u8BCF\u4EE4\u5185\u5BB9\u653E\u56DE\u5230\u5F53\u65F6\u7684\u5B9E\u9645\u80CC\u666F\u4E2D\u53BB\u8003\u5BDF\u3002</p><p>\u4E3A\u4E86\u4FBF\u4E8E\u5927\u591A\u6570\u4EBA\u7406\u89E3\uFF0C\u4E0D\u59A8\u5148\u7528\u201C\u516C\u53F8\u201D\u4E3E\u4E2A\u4F8B\uFF1A\u4F60\u63A5\u624B\u4E86\u4E00\u5BB6\u516C\u53F8\uFF0C\u4E1A\u52A1\u5B9E\u529B\u4E00\u822C\u822C\uFF0C\u4F46\u516C\u53F8\u5185\u90E8\u5374\u4EBA\u5FC3\u6DA3\u6563\u3001\u7EAA\u5F8B\u677E\u5F1B\u3001\u5C71\u5934\u6797\u7ACB\u3002\u6709\u624D\u80FD\u7684\u9AA8\u5E72\u5458\u5DE5\u65E9\u5DF2\u5404\u5954\u4E1C\u897F\uFF0C\u7559\u4E0B\u7684\u90FD\u662F\u4E9B\u6C34\u5E73\u6B21\u3001\u8D23\u4EFB\u5FC3\u5DEE\u7684\u4EBA\u3002\u81F3\u4E8E\u4EC0\u4E48\u5171\u540C\u7684\u4EF7\u503C\u89C2\uFF0C\u90A3\u5C31\u6839\u672C\u4E0D\u8981\u63D0\u4E86\uFF0C\u635F\u516C\u80A5\u5DF1\u3001\u501F\u7740\u516C\u53F8\u7ED9\u81EA\u5DF1\u8C0B\u79C1\uFF0C\u8FD9\u624D\u7559\u4E0B\u6765\u7684\u4EBA\u7684\u552F\u4E00\u5171\u540C\u613F\u666F\u3002</p><p>\u8FD9\u5C31\u662F\u5B87\u6587\u6CF0\u5F53\u5E74\u63A5\u624B\u7684\u70C2\u644A\u5B50\u3002</p><p>\u5F53\u7136\uFF0C\u8FD9\u4E5F\u4E0D\u80FD\u602A\u5B87\u6587\u6CF0\uFF0C\u5F53\u65F6\u6574\u4E2A\u5929\u4E0B\u57FA\u672C\u4E0A\u90FD\u662F\u8FD9\u4E2A\u6837\u5B50\u4E86\u3002<strong>\u5728\u591A\u5E74\u6218\u4E71\u4EE5\u540E\uFF0C\u8FD9\u662F\u653F\u6CBB\u5931\u5E8F\u7684\u5FC5\u7136\u7ED3\u679C\u3002</strong></p><p>\u53EA\u662F\u9762\u4E34\u7740\u540C\u6837\u7684\u95EE\u9898\uFF0C<code>\u9AD8\u6B22</code>\u5C1A\u80FD\u7EF4\u6301\uFF0C\u4ED6\u5BB6\u5E95\u539A\uFF0C\u8DB3\u4EE5\u5728\u5B9E\u529B\u4E0A\u78BE\u538B\u5B87\u6587\u6CF0\u2014\u2014\u5C31\u597D\u6BD4\u5927\u56FD\u4F01\uFF0C\u5373\u4FBF\u767E\u75C5\u4E1B\u751F\uFF0C\u4F46\u771F\u6B63\u8D70\u5230\u4E86\u7834\u4EA7\u8FB9\u7F18\u7684\u53C8\u6709\u51E0\u5BB6\u5462\uFF1F\u53EA\u8981\u95EE\u9898\u4E0D\u81F4\u547D\uFF0C\u5728\u98CE\u96E8\u98D8\u6447\u4E2D\u5C31\u603B\u80FD\u518D\u521B\u4F73\u7EE9\u3002</p><p>\u4F46\u5B87\u6587\u6CF0\u5374\u4E0D\u540C\uFF0C\u4ED6\u53EA\u662F\u8258\u5C0F\u7834\u8239\uFF0C\u52A8\u8F84\u5C31\u6709\u503E\u8986\u4E4B\u5371\u3002</p><p>\u800C\u4E14\uFF0C\u8FD8\u6709\u4E2A\u5F88\u9EBB\u70E6\u7684\u5730\u65B9\u5728\u4E8E\uFF1A<strong>\u8FD9\u65F6\u7684\u5B87\u6587\u6CF0\u8FD8\u4E0D\u5230\u4E09\u5341\u5C81\uFF0C\u51E0\u4E4E\u6CA1\u6709\u4EFB\u4F55\u6CBB\u7406\u56FD\u653F\u7684\u7ECF\u9A8C\u3002</strong></p><p>\u4F46\u6216\u8BB8\uFF0C\u4E5F\u6B63\u56E0\u4E3A\u5982\u6B64\uFF0C\u5B87\u6587\u6CF0\u624D\u80FD\u5145\u5206\u91C7\u7EB3\u6C49\u4EBA\u82CF\u7EF0\u7ED9\u4ED6\u63D0\u51FA\u7684\u8FD9\u4E9B\u610F\u89C1\u2014\u2014<strong>\u8FD9\u4E9B\u610F\u89C1\uFF0C\u5B8C\u5168\u4E0D\u662F\u585E\u5916\u80E1\u4EBA\u7EDF\u6CBB\u6C49\u5730\u7684\u65B9\u6CD5\uFF0C\u800C\u662F\u4E0A\u5343\u5E74\u6765\u6C49\u5730\u6210\u719F\u7684\u6CBB\u7406\u7ECF\u9A8C\u3002</strong></p><p><strong>\u7B2C\u4E00\u4EF6\u4E8B\u662F<code>\u6B63\u5FC3</code></strong>\u3002</p><p>\u6B63\u5FC3\uFF0C\u4E0D\u662F\u8981\u4F60\u7AEF\u6B63\u6001\u5EA6\uFF0C\u800C\u662F\u8BF4\u4F5C\u4E3A\u9886\u5BFC\u8005\uFF0C\u4F60\u9996\u5148\u8981\u81EA\u5DF1\u5728\u601D\u60F3\u4E0A\u8BA4\u8BC6\u5230\u6B63\u4E49\u826F\u77E5\u7684\u91CD\u8981\uFF1B\u540C\u65F6\uFF0C\u8FD8\u8981\u7528\u53E4\u4EE3\u5148\u8D24\u521B\u7ACB\u7684\u9053\u5FB7\u89C4\u8303\u6765\u8981\u6C42\u81EA\u5DF1\uFF0C\u505A\u5230\u8EAB\u4F53\u529B\u884C\u3002</p><p>\u8FD9\u79CD\u8981\u6C42\u770B\u8D77\u6765\u5F88\u50CF\u662F\u5E9F\u8BDD\uFF0C\u4F46\u5728\u5F53\u65F6\u7684\u73AF\u5883\u4E2D\u5374\u5F25\u8DB3\u73CD\u8D35\uFF1A\u5317\u65B9\u5DF2\u7ECF\u5927\u4E71\u4E86\u51E0\u767E\u5E74\uFF0C\u671F\u95F4\u591A\u5F97\u662F\u5982\u9AD8\u6B22\u4E00\u6837\u51ED\u501F\u8BC8\u529B\u53D6\u80DC\u7684\u67AD\u96C4\u8C6A\u6770\uFF0C\u4EC1\u4E49\u9053\u5FB7\u5DF2\u88AB\u5F03\u4E4B\u5982\u655D\u5C65\u3002\u771F\u6B63\u80FD\u505A\u5230\u4F20\u7EDF\u58EB\u5927\u592B\u9053\u5FB7\u8981\u6C42\u7684\uFF0C\u5982<code>\u82FB\u575A</code>\u4E00\u6837\u7684\u4EBA\uFF0C\u53CD\u5012\u8EAB\u6B7B\u65CF\u706D\u3002</p><p>\u5728\u8FD9\u79CD\u73AF\u5883\u4E0B\uFF0C\u82CF\u7EF0\u8981\u6C42\u5B87\u6587\u6CF0\u201C\u5148\u6CBB\u5FC3\u201D\uFF0C\u7B80\u76F4\u5C31\u662F\u5728\u201C\u9006\u5386\u53F2\u6F6E\u6D41\u800C\u52A8\u201D\u3002</p><p>\u4F46\u662F\uFF0C<strong>\u4E5F\u53EA\u6709\u505A\u5230\u4E86\u8FD9\u4E00\u6B65\uFF0C\u624D\u80FD\u5F00\u59CB\u4E0B\u9762\u7684\u6B65\u9AA4</strong>\uFF1A\u53EA\u6709\u6700\u9AD8\u5C42\u505A\u5230\u4E86\u63A8\u884C\u4EC1\u4E49\uFF0C\u63A5\u4E0B\u6765\u624D\u80FD\u5BFB\u627E\u5230\u4EF7\u503C\u89C2\u4E00\u81F4\u7684\u4EBA\uFF0C\u4E00\u8D77\u6784\u5EFA\u6574\u4E2A\u884C\u653F\u4F53\u7CFB\u2014\u2014\u8FD9\u4E00\u6761\uFF0C\u88AB\u82CF\u7EF0\u79F0\u4E3A\u201C<code>\u64E2\u8D24\u826F</code>\u201D\u3002</p><p>\u5728\u8FD9\u91CC\uFF0C\u6211\u4EEC\u53C8\u9047\u5230\u4E86\u5386\u53F2\u4E0A\u53CD\u590D\u51FA\u73B0\u7684\u201C\u5FB7\u624D\u4E4B\u8FA9\u201D\uFF1A\u7528\u4EBA\uFF0C\u5230\u5E95\u662F\u8BE5\u4EE5\u5FB7\u4F18\u5148\uFF1F\u8FD8\u662F\u4EE5\u624D\u4F18\u5148\uFF1F\u5B87\u6587\u6CF0\u548C\u82CF\u7EF0\u7684\u9009\u62E9\uFF0C\u8FD8\u662F\u504F\u5411\u4E8E\u9053\u5FB7\u6807\u51C6\u7684\uFF1A\u65E2\u7136\u8981\u5EFA\u7ACB\u4E00\u5957\u63A8\u884C\u4EC1\u4E49\u7684\u4EF7\u503C\u89C2\uFF0C\u90A3\u4E48\u9996\u5148\u5C31\u9700\u8981\u8BA4\u540C\u8FD9\u5957\u4EF7\u503C\u4F53\u7CFB\u7684\u4EBA\u5B58\u5728\u4E8E\u5404\u7EA7\u884C\u653F\u7CFB\u7EDF\u4E2D\u3002</p><p>\u5982\u679C\u8FD9\u4E24\u6761\u80FD\u505A\u5230\uFF0C\u63A5\u4E0B\u6765\uFF0C\u5C31\u662F\u56DB\u6761\u5177\u4F53\u7684\u63AA\u65BD\u4E86\uFF1A\u6566\u6559\u5316\u3001\u5C3D\u5730\u5229\u3001\u6064\u72F1\u8BBC\u3001\u5747\u8D4B\u5F79\u3002</p><p><code>\u6566\u6559\u5316</code>\uFF0C\u662F\u8981\u628A\u671D\u5EF7\u7684\u4EF7\u503C\u89C2\u53D6\u5411\u63A8\u800C\u5E7F\u4E4B\uFF0C\u5411\u6240\u6709\u6C11\u4F17\u666E\u53CA\uFF0C\u5728\u5168\u793E\u4F1A\u5F62\u6210\u4EC1\u4E0E\u793C\u7684\u98CE\u6C14\u3002</p><p><code>\u5C3D\u5730\u5229</code>\uFF0C\u662F\u8981\u8BA9\u8001\u767E\u59D3\u4EE5\u65F6\u8015\u4F5C\uFF0C\u4E0D\u52A8\u8F84\u5F81\u53D1\u767E\u59D3\u670D\u5F79\u3002</p><p><code>\u6064\u72F1\u8BBC</code>\u4E0E<code>\u5747\u8D4B\u5F79</code>\uFF0C\u9488\u5BF9\u7684\u5219\u662F\u516C\u5E73\u3002\u5728\u771F\u5B9E\u73AF\u5883\u4E2D\uFF0C\u771F\u6B63\u80FD\u8BA9\u767E\u59D3\u4FE1\u670D\u671D\u5EF7\u7684\uFF0C\u4E00\u5B9A\u662F\u516C\u5E73\u3002\u4E0D\u60A3\u5BE1\u800C\u60A3\u4E0D\u5747\uFF0C\u8FD9\u6C38\u8FDC\u662F\u666E\u901A\u6C11\u4F17\u8003\u8651\u95EE\u9898\u65F6\u7684\u4F18\u5148\u9009\u9879\u3002</p><p>\u8FD9\u4E48\u4E00\u7EC6\u770B\uFF0C\u4F60\u4F1A\u53D1\u73B0\u82CF\u7EF0\u516D\u6761\u5E76\u6CA1\u6709\u4EC0\u4E48\u65B0\u7684\u53D1\u660E\u521B\u5EFA\uFF0C\u53EA\u662F\u5BF9\u4F20\u7EDF\u4E0A\u5112\u5BB6\u6CBB\u7406\u56FD\u5BB6\u7684\u65B9\u5F0F\u65B9\u6CD5\u91CD\u65B0\u505A\u4E86\u4E00\u4E2A\u68B3\u7406\u4E0E\u603B\u7ED3\u3002</p><p>\u5982\u679C\u653E\u5728\u627F\u5E73\u65F6\u4EE3\uFF0C\u8FD9\u4E9B\u63AA\u65BD\u6CA1\u6709\u4EFB\u4F55\u7684\u7279\u6B8A\u4E4B\u5904\uFF0C\u4F46\u662F\uFF0C\u5728\u5357\u5317\u671D\u65F6\u671F\uFF0C\u5B87\u6587\u6CF0\u7684\u505A\u6CD5\u5C31\u7B80\u76F4\u662F\u4E09\u56FD\u6DF7\u6218\u5C4A\u7684\u4E00\u80A1\u6E05\u6D41\u4E86\u3002</p><p>\u6211\u4EEC\u5728\u6B64\u524D\u7684\u6587\u7AE0\u66FE\u7ECF\u4ECB\u7ECD\u8FC7\uFF0C\u540C\u4E00\u65F6\u671F\uFF0C\u5176\u4ED6\u56FD\u5BB6\u7684\u653F\u6CBB\u98CE\u6C14\u4E0E<code>\u897F\u9B4F\uFF08\u5317\u5468\uFF09</code>\u7684\u4EF7\u503C\u53D6\u5411\u662F\u5B8C\u5168\u4E0D\u540C\u7684\uFF1A<code>\u4E1C\u9B4F\uFF08\u5317\u9F50\uFF09</code>\u5BF9\u4E8E\u5B98\u5458\u8D2A\u8150\u7684\u6001\u5EA6\u662F\u7EB5\u5BB9\uFF0C\u9C9C\u5351\u8D35\u65CF\u5BF9\u6C49\u4EBA\u767E\u59D3\u4E0D\u65AD\u76D8\u5265\uFF1B\u5357\u65B9\uFF0C\u73B0\u5728\u4F9D\u7136\u662F\u4E16\u5BB6\u5927\u65CF\u7684\u5929\u4E0B\uFF0C\u6B64\u65F6\u7684<code>\u8427\u6881</code>\u6B63\u6C89\u9189\u5728\u4F5B\u6CD5\u660C\u76DB\u3001\u6587\u5B66\u7E41\u8363\u7684\u865A\u5E7B\u4E4B\u4E2D\uFF0C\u5168\u7136\u65E0\u6CD5\u9884\u6599\u5341\u51E0\u5E74\u4EE5\u540E\uFF0C<code>\u4FAF\u666F</code>\u5C06\u8981\u7ED9\u5E26\u6765\u4ED6\u4EEC\u4EC0\u4E48\u6837\u7684\u706D\u9876\u4E4B\u707E\u3002</p><p><strong>\u53EA\u6709\u5317\u5468\uFF0C\u5728\u653F\u6CBB\u5EFA\u8BBE\u7684\u8F68\u9053\u4E0A\uFF0C\u6B63\u4E00\u6B65\u4E00\u4E2A\u811A\u5370\uFF0C\u8E0F\u8E0F\u5B9E\u5B9E\u7684\u5F80\u524D\u8D70\u7740</strong>\uFF1A\u52AA\u529B\u6784\u5EFA\u6B63\u5E38\u7684\u884C\u653F\u7CFB\u7EDF\uFF1B\u901A\u8FC7\u5E9C\u5175\u5236\uFF0C\u89E3\u51B3\u5175\u529B\u6765\u6E90\u548C\u653F\u6743\u672C\u571F\u5316\u95EE\u9898\uFF1B\u4EE5\u53CA\uFF0C\u7ECF\u8FC7<code>\u5B87\u6587\u6CF0</code>\u3001<code>\u5B87\u6587\u62A4</code>\u3001<code>\u5B87\u6587\u9095</code>\u4E09\u4EE3\u6267\u653F\u8005\u7684\u4E2D\u592E\u96C6\u6743\u52AA\u529B\u2026\u2026\u7EC8\u4E8E\uFF0C\u5317\u5468\u88AB\u5851\u9020\u6210\u4E86\u4E00\u4E2A\u6807\u51C6\u610F\u4E49\u4E0A\u7684\u5E1D\u5236\u738B\u671D\u3002</p><p>\u7136\u540E\uFF0C\u8FD9\u4E2A\u738B\u671D\u7206\u53D1\u51FA\u4E86\u60CA\u4EBA\u7684\u80FD\u91CF\u3002</p><p>\u751A\u81F3\u4E8E\uFF0C<strong>\u5982\u679C\u4ECE\u5317\u5468\u706D\u9F50\u7684\u90A3\u4E2A\u65F6\u95F4\u70B9\u4E0A\u6765\u770B\uFF0C\u90A3\u4E48\u81EA\u4ECE\u5218\u6E0A\u81EA\u7ACB\u3001\u4E94\u80E1\u4E71\u534E\u4EE5\u6765\uFF0C\u79E6\u6C49\u7B2C\u4E00\u5E1D\u56FD\u7684\u6C89\u75B4\u5DF2\u7ECF\u57FA\u672C\u4E0A\u5168\u90E8\u89E3\u51B3\uFF1A</strong></p><p>\u8FD1\u4E09\u767E\u5E74\u7684\u6C11\u65CF\u9694\u9602\uFF0C\u7ECF\u8FC7\u6218\u4E71\u6740\u622E\u4EE5\u53CA<code>\u9B4F\u5B5D\u6587\u5E1D</code>\u4E0E<code>\u5B87\u6587\u6CF0</code>\u7684\u6539\u5236\uFF0C\u5DF2\u7ECF\u5B8C\u6210\u4E86\u878D\u5408\uFF1B\u5317\u65B9\u957F\u671F\u6DF7\u4E71\u5BFC\u81F4\u7684\u653F\u6CBB\u5931\u5E8F\uFF0C\u5728\u5317\u5468\u5B8C\u6210\u4E86\u91CD\u5EFA\uFF1B\u901A\u8FC7\u8BBE\u8BA1\u5E9C\u5175\u5236\uFF0C\u5317\u5468\u53C8\u5B8C\u6210\u4E86\u519B\u4E8B\u5B9E\u529B\u8F93\u51FA\u7684\u95EE\u9898\u3002</p><p>\u5728\u540C\u4E00\u4E2A\u65F6\u4EE3\u4E2D\uFF0C\u7BA1\u7406\u5B66\u4E0A\u771F\u6B63\u7684\u7406\u5FF5\u521B\u65B0\uFF0C\u5176\u5B9E\u662F\u6781\u5C11\u7684\u3002</p><p>\u800C\u4E14\uFF0C\u4E00\u65E6\u6709\u4E86\u4E5F\u5F88\u96BE\u4FDD\u6301\u673A\u5BC6\u3002\u4E00\u79CD\u7BA1\u7406\u6A21\u5F0F\u7684\u9769\u65B0\uFF0C\u603B\u4F1A\u5728\u5F88\u77ED\u7684\u65F6\u95F4\u5185\u5C31\u88AB\u4F20\u64AD\u51FA\u53BB\u3002</p><p>\u8FD9\u4F3C\u4E4E\u4E0E\u7EDD\u5927\u591A\u6570\u4EBA\u7684\u5370\u8C61\u4E0D\u7B26\uFF0C\u56E0\u4E3A\u5728\u6211\u4EEC\u770B\u6765\uFF0C\u73B0\u5B9E\u4E2D\u597D\u50CF\u603B\u6709\u5404\u79CD\u56E0\u4E3A\u7BA1\u7406\u7406\u5FF5\u4E0D\u540C\u800C\u4F53\u73B0\u51FA\u6765\u7684\u5DEE\u522B\u3002</p><p>\u4F46\u4E8B\u5B9E\u4E0A\uFF0C<strong>\u90A3\u5E76\u4E0D\u662F\u7BA1\u7406\u7406\u5FF5\u7684\u4E0D\u540C\uFF0C\u800C\u662F<code>\u6267\u884C\u529B</code>\u7684\u4E0D\u540C</strong>\u3002</p><p>\u5728\u4E0D\u540C\u7684\u7EA6\u675F\u6761\u4EF6\u4E4B\u4E0B\uFF0C\u6BCF\u4E2A\u4EBA\u7684\u9009\u62E9\u662F\u4E0D\u540C\u7684\u3002\u867D\u7136\u76EE\u6807\u90FD\u5728\u90A3\u91CC\uFF0C\u4F46\u662F\u901A\u5411\u5F7C\u5CB8\u7684\u8DEF\u5D0E\u5C96\u574E\u5777\uFF0C\u6EE1\u5E03\u8346\u68D8\uFF0C\u6700\u540E\u80FD\u8D70\u5230\u54EA\u4E00\u6B65\uFF0C\u6BCF\u4E2A\u4EBA\u90FD\u5404\u4E0D\u76F8\u540C\u3002</p><p>\u9000\u56DE\u5230\u5386\u53F2\u4E2D\u6765\u770B\uFF0C\u4E3A\u4EC0\u4E48\u5317\u5468\u80FD\u91CD\u5EFA\u653F\u6CBB\u79E9\u5E8F\uFF0C\u5317\u9F50\u5374\u5750\u5931\u826F\u673A\uFF1F\u7EA6\u675F\u6761\u4EF6\u5C31\u662F\u539F\u56E0\uFF1B\u540C\u65F6\uFF0C\u9886\u5BFC\u8005\u4E2A\u4EBA\u7684\u9009\u62E9\u548C\u51B3\u5FC3\uFF0C\u4E5F\u662F\u4E0D\u5BB9\u5FFD\u89C6\u7684\u91CD\u8981\u56E0\u7D20\u3002</p><p>\u91CD\u5EFA\u653F\u6CBB\u79E9\u5E8F\uFF0C\u8FD9\u9700\u8981\u6267\u653F\u8005\u6709\u575A\u5F3A\u7684\u6BC5\u529B\uFF0C\u5E76\u4ED8\u51FA\u957F\u671F\u4E0D\u61C8\u7684\u52AA\u529B\uFF0C\u8FD9\u662F\u6162\u529F\u592B\uFF0C\u4E5F\u662F\u7B28\u529F\u592B\uFF0C\u5B83\u5728\u77ED\u671F\u5185\u53EA\u6709\u4ED8\u51FA\uFF0C\u4F46\u957F\u671F\u770B\u6765\u5374\u56DE\u62A5\u4E30\u539A\u3002</p><p>\u6709\u4EBA\u80FD\u4EE5\u8BC8\u529B\u53D6\u80DC\uFF0C\u81EA\u7136\u4E5F\u5C31\u6709\u4EBA\u80FD\u8E0F\u8E0F\u5B9E\u5B9E\u7684\u4ECE\u6839\u57FA\u505A\u8D77\uFF0C\u56FA\u672C\u57F9\u5143\uFF0C\u539A\u79EF\u8584\u53D1\u3002</p><p>\u91CD\u5251\u65E0\u950B\uFF0C\u5927\u5DE7\u4E0D\u5DE5\u3002</p>',43),r=[t];function n(s,l){return o(),e("div",null,r)}const a=p(d,[["render",n],["__file","72.html.vue"]]);export{a as default};
